(66, 'sRy0Fhjz3gY', 'Shahi Chicken Korma Recipe | chicken korma | chicken shahi korma | murgh korma | Delicious Pakwan', 'This is a very simple recipe that teaches you how to make delicious Shahi Chicken Korma. Shahi Korma is a rich & creamy dish.\nYou Must try this recipe. All the process to make this delicious shahi chicken korma...\nShahi Chicken Korma Recipe | chicken korma | chicken shahi korma | murgh korma | Delicious Pakwan\n--------------------------------------------------------\nIngredients:\nFor Marination\n300 grams Chicken (bone-in)\n1 tbsp Lemon Juice\n1 tsp Ginger Garlic Paste\n1/2 tsp Salt\nFor Masala Paste\n1 tsp Coriander \n1 tsp Shahi Jeera\n3 - 4 Black Peppercorns\n2 Cloves\n10 - 12 Cashewnuts\n10. almonds\n1 tbsp desiccated coconut\n1/2 tsp Fennel Seeds\n1/2 cup Yogurt\n-------------------------------------------------------\nFor Korma Gravy\n2 large Onions Sliced thinly\n2 tsp Ginger Garlic Green Chilli Paste\n1/4 cup Ghee / Clarified Butter\n2 Green Cardamoms\n3/4 - 1 tsp Garam Masala\n1/2 tsp Red Chilli Powder\n1 cup Water\nSalt to taste\n-------------------------------------------------------\n#chickenkorma\n#shahichickenkorma\n#deliciouspakwan\n--------------------------------------------------------\n\nPlease support my channel by SUBSCRIBE to my channel and share my videos in your Social Network TimeLines.\n\nDon''t Forget to Follow me on all Social Network, \n\nWebsite Link: http://www.deliciouspakwan.com\nFacebook Link: https://www.facebook.com/deliciouspakwan\nInstagram Link: https://www.instagram.com/deliciouspakwan\nTwitter Link: https://twitter.com/PakwanDelicious\nMy Youtube Channel: https://bit.ly/3gJY3mQ\nDelicious Pakwan Blog: https://deliciouspakwanblog.blogspot.com\n\n--------------------------------------------------------\nThanks for watching this video..!!', 'https://www.youtube.com/watch?v=sRy0Fhjz3gY', 'https://i.ytimg.com/vi/sRy0Fhjz3gY/mqdefault.jpg', '2020-10-05T12:45:02Z', '10', 144, 4, 13, '100', '/video/sRy0Fhjz3gY